INSERT INTO `news` VALUES (76,'Барилгын хог хаягдлын менежментийн төслийн хаалтын үйл ажиллагаа','<p style=\"margin-right: 0px; margin-bottom: 16px; margin-left: 0px; padding: 0px; text-size-adjust: 100%; text-indent: 2em; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; font-size: 15px; text-align: justify;\"><span class=\"ikon-shareable-twitter\" style=\"margin: 0px; padding: 0px 4px 0px 0px; text-size-adjust: 100%; background-color: rgb(233, 235, 228); cursor: pointer;\">УЛААНБААТАР, Монгол улс – 2016-2020 оны хооронд Европын холбооны SWITCH-Asia хөтөлбөр болоод Чехийн Хөгжлийн Агентлагийн дэмжлэгтэй хэрэгжсэн “Монгол улсын барилгын салбарын нөөцийн үр ашигтай байдал, цэвэр үйлдвэрлэлийг дэмжих төсөл” – ийн хаалтын үйл ажиллагаа 10-р сарын 30-нд зохион байгуулагдлаа.</span></p><div class=\"fb-quote fb_iframe_widget\" data-layout=\"quote\" fb-xfbml-state=\"rendered\" fb-iframe-plugin-query=\"app_id=1410230139213728&amp;container_width=680&amp;href=https%3A%2F%2Fikon.mn%2Fn%2F20xb&amp;layout=quote&amp;locale=mn_MN&amp;sdk=joey\" style=\"margin: 0px; padding: 0px; text-size-adjust: 100%; display: inline-block; position: absolute; left: 5px; top: 121px;\"><span style=\"margin: 0px; padding: 0px; text-size-adjust: 100%; display: inline-block; position: relative; text-align: justify; vertical-align: bottom; width: 211px; height: 47px;\"><iframe name=\"f1209d16700db88\" width=\"1000px\" height=\"1000px\" data-testid=\"fb:quote Facebook Social Plugin\" title=\"fb:quote Facebook Social Plugin\" frameborder=\"0\" allowtransparency=\"true\" allowfullscreen=\"true\" scrolling=\"no\" allow=\"encrypted-media\" src=\"https://www.facebook.com/v7.0/plugins/quote.php?app_id=1410230139213728&amp;channel=https%3A%2F%2Fstaticxx.facebook.com%2Fx%2Fconnect%2Fxd_arbiter%2F%3Fversion%3D46%23cb%3Df280860dd92cb94%26domain%3Dikon.mn%26origin%3Dhttps%253A%252F%252Fikon.mn%252Ff346c7a87127408%26relation%3Dparent.parent&amp;container_width=680&amp;href=https%3A%2F%2Fikon.mn%2Fn%2F20xb&amp;layout=quote&amp;locale=mn_MN&amp;sdk=joey\" class=\"\" style=\"margin: 0px auto; padding: 0px; text-size-adjust: 100%; position: absolute; border-width: initial; border-style: none; visibility: visible; width: 211px; height: 47px;\"></iframe></span></div><p></p><p style=\"margin: 16px 0px; padding: 0px; text-size-adjust: 100%; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; font-size: 15px; text-align: justify;\">Энэхүү хаалтын үйл ажиллагаанд барилгын салбарын жижиг дунд үйлдвэрлэл (ЖДҮ) эрхлэгчид, барилгын материал үйлдвэрлэгчид, их сургуулийн багш, эрдэмтэд, төслийн оролцогч талууд, холбогдох төрийн болон төрийн бус байгууллагуудын төлөөлөл болоод төслийн санхүүжүүлэгчид оролцлоо.</p><p style=\"margin-right: 0px; margin-bottom: 16px; margin-left: 0px; padding: 0px; text-size-adjust: 100%; text-indent: 2em; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; font-size: 15px; text-align: justify;\"><strong style=\"margin: 0px; padding: 0px; text-size-adjust: 100%; color: rgb(69, 77, 98);\"></strong></p><p style=\"margin: 16px 0px; padding: 0px; text-size-adjust: 100%; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; font-size: 15px; text-align: justify;\"><em style=\"margin: 0px; padding: 0px; text-size-adjust: 100%;\">”</em><em style=\"margin: 0px; padding: 0px; text-size-adjust: 100%;\">&nbsp;Европын Холбоо нь</em>&nbsp;<em style=\"margin: 0px; padding: 0px; text-size-adjust: 100%;\">тогтвортой хөгжил, нүүрстөрөгч багатай, нөөцийн үр ашигтай тойрог эдийн засагт шилжих үйл явцыг дэмжин ажилладаг. Сүүлийн жилүүдэд барилгын буулгалт нураалтаас үүссэн хог хаягдал эрчимтэй нэмэгдэх болсон хэдий ч түүнийг дахин боловсруулж ашигладаггүй, ихэнх тохиолдолд хууль бусаар ил задгай хаягдаж байгаль орчинг бохирдуулах болсон. Иймд бид 2016 оноос эхлэн тус төсөл хөтөлбөрийг хэрэгжүүлж эхэлсэн юм. Өнөөдрийн энэхүү арга хэмжээгээр төслийн ололт амжилтыг цохон тэмдэглэж, улмаар төслийн үйл ажиллагааг цаашид тогтвортой үргэлжлүүлэх талаар ярилцах боломж гарч байна”</em>&nbsp;хэмээн&nbsp;<strong style=\"margin: 0px; padding: 0px; text-size-adjust: 100%; color: rgb(69, 77, 98);\">Европын Холбооноос Монгол улсад суугаа бүрэн эрхт төлөөлөгч Траян Христеа нээлтийн үгэндээ онцлон тэмдэглэлээ.</strong><img src=\"data:image/png;base64,\" style=\"width: 1058px;\" data-filename=\"47739909-841d2b80-dc87-11e8-923a-c6bbd6cd8e05.png\">Тус төсөл хөтөлбөр нь барилгын салбарын ЖДҮ эрхлэгчдэд барилгын нөөцийн үр ашигтай&nbsp;байдал болон тогтвортой цэвэр үйлдвэрлэл, хэрэглээг үйл ажиллагаандаа нэвтрүүлэн хэрэгжүүлэхэд нь дэмжлэг үзүүлэх замаар Монгол улс дахь ядуурал, цаг уурын өөрчлөлтийг бууруулахад хувь нэмрээ оруулах зорилготойгоор хэрэгжсэн байна. Каритас Чех Репаблик (КЧР) Монгол дахь суурин төлөөлөгчийн газар нь барилгын хог хаягдлыг дахин ашиглаж, бүтээгдэхүүн гарган авах, улмаар нүүрстөрөгчийг хийг бууруулах зорилгын хүрээнд Шинжлэх Ухаан, Технологийн Их Сургууль (ШУТИС) – ийн харъяа Барилга Архитектурийн Сургууль (БАС) - ийн судалгааны багтай хамтран барилгын буулгалт нураалтаас үүссэн хог хаягдалд суурилсан бүтээгдэхүүн гарган авч, хөгжүүлсэн. Улмаар тухайн бүтээгдэхүүний холбогдох стандартуудыг нь эрх бүхий байгууллагаар батлуулсан байна.</p><p style=\"margin: 16px 0px; padding: 0px; text-size-adjust: 100%; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; font-size: 15px; text-align: justify;\">Түүнчлэн, “Барилгын хог хаягдал боловсруулах технологи” хичээлийг боловсруулан ШУТИС-ийн харъяа БАС-ийн хичээлийн хөтөлбөрт тусгасан юм. Тус хичээлийн хөтөлбөрөөс гадна барилгын хог хаягдлын өнөөгийн нөхцөл байдлын талаар судалгаа шинжилгээ хийн хэвлүүлэн цахим хэлбэрээр байршуулсан байна. Мөн барилгын салбарын 3000 гаруй төлөөлөгчийг барилгын хог хаягдалд суурилсан бүтээгдэхүүн, түүний технологи, менежментийн сургалтанд хамруулан бэлтгэжээ.</p><p style=\"margin: 16px 0px; padding: 0px; text-size-adjust: 100%; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; font-size: 15px; text-align: justify;\"><br></p><p style=\"margin: 16px 0px; padding: 0px; text-size-adjust: 100%; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; font-size: 15px; text-align: justify;\"><img src=\"data:image/png;base64,\" style=\"width: 760px;\" data-filename=\"538f0fc0460226057d55ac803fe3db57.png\"></p><p style=\"margin: 16px 0px; padding: 0px; text-size-adjust: 100%; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; font-size: 15px; text-align: justify;\"><br></p><p class=\"phalf\" style=\"margin: 16px 0px; padding: 0px; text-size-adjust: 100%; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; font-size: 15px; text-align: justify;\"><em style=\"margin: 0px; padding: 0px; text-size-adjust: 100%;\">“Харваач мэргэн констракшн байгууллага нь барилгын буулгалтын чиглэлээр үйл ажиллагаа явуулдаг бөгөөд манай байгууллагын ажилтан, инженерүүд энэхүү төсөл хөтөлбөрийн сургалт, семинарт идэвхитэй оролцсон. Эдгээр сургалтын үр дүнд бид ухаалаг буулгалтыг практиктаа нэвтрүүлж, барилгын хог хаягдлыг дахин ашиглаж байгаа. Жишээ дурьдвал, Хэнтий аймагт бид барилгын 38000 тонн</em></p><div class=\"fb-quote fb_iframe_widget\" data-layout=\"quote\" fb-xfbml-state=\"rendered\" fb-iframe-plugin-query=\"app_id=1410230139213728&amp;container_width=680&amp;href=https%3A%2F%2Fikon.mn%2Fn%2F20xb&amp;layout=quote&amp;locale=mn_MN&amp;sdk=joey\" style=\"margin: 0px; padding: 0px; text-size-adjust: 100%; display: inline-block; position: absolute; left: 154px; top: 2055px;\"><em style=\"margin: 0px; padding: 0px; text-size-adjust: 100%;\"><span style=\"margin: 0px; padding: 0px; text-size-adjust: 100%; display: inline-block; position: relative; text-align: justify; vertical-align: bottom; width: 211px; height: 47px;\"><iframe name=\"f1209d16700db88\" width=\"1000px\" height=\"1000px\" data-testid=\"fb:quote Facebook Social Plugin\" title=\"fb:quote Facebook Social Plugin\" frameborder=\"0\" allowtransparency=\"true\" allowfullscreen=\"true\" scrolling=\"no\" allow=\"encrypted-media\" src=\"https://www.facebook.com/v7.0/plugins/quote.php?app_id=1410230139213728&amp;channel=https%3A%2F%2Fstaticxx.facebook.com%2Fx%2Fconnect%2Fxd_arbiter%2F%3Fversion%3D46%23cb%3Df280860dd92cb94%26domain%3Dikon.mn%26origin%3Dhttps%253A%252F%252Fikon.mn%252Ff346c7a87127408%26relation%3Dparent.parent&amp;container_width=680&amp;href=https%3A%2F%2Fikon.mn%2Fn%2F20xb&amp;layout=quote&amp;locale=mn_MN&amp;sdk=joey\" class=\"\" style=\"margin: 0px auto; padding: 0px; text-size-adjust: 100%; position: absolute; border-width: initial; border-style: none; visibility: visible; width: 211px; height: 47px;\"></iframe></span></em></div><p style=\"margin: 16px 0px; padding: 0px; text-size-adjust: 100%; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; font-size: 15px; text-align: justify;\">&nbsp;<em style=\"margin: 0px; padding: 0px; text-size-adjust: 100%;\">хог хаягдлаас модон материалыг нь салган авч 120 орчим айлуудад түлээний модны зориулалтаар буулгаж өгсөн. Мөн барилгын буулгалт, хөрс тэгшилтээс бий болсон 200 гаруй машин шороогоор Хэнтий аймгийн сэтэрсэн далангийн нөхөн сэргээлтэнд ашиглуулсан. Түүнчлэн, Гаалийн Ерөнхий газрын 3, 4 объектыг буулгаад, үүнээс 85 хувийг нь дахин ашиглагдахаар болгоод Сэлэнгэ аймгийн Спорт заалыг барьж, тохижуулахад хэрэглүүлсэн. Энэ мэтчилэн жишээ яриад байвал олон бий. Тиймээс барилгын салбарын бүтээн байгуулалтад хувь нэмэр оруулсан энэхүү төслийн багийн хамт олонд талархсанаа илэрхийлэх нь зүйтэй байхаа</em><em style=\"margin: 0px; padding: 0px; text-size-adjust: 100%;\">“&nbsp;</em>хэмээн&nbsp;<strong style=\"margin: 0px; padding: 0px; text-size-adjust: 100%; color: rgb(69, 77, 98);\">Харваач Мэргэн ХХК-ийн захирал М.Лхагважав хэллээ.</strong></p><p></p><p style=\"margin: 16px 0px; padding: 0px; text-size-adjust: 100%; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; font-size: 15px; text-align: justify;\">Төслийн үр дүнд барилгын хог хаягдлын менежментийн хууль, эрх зүйн орчныг сайжруулах үүднээс “Барилгын хог хаягдлыг цэвэрлэх, цуглуулах, ангилах, тээвэрлэх, дахин боловсруулах, сэргээн ашиглах, устгах, булшлах журам” боловсруулан, Барилга Хот Байгуулалтын Яамаар батлуулсан байна. Тус журам нь барилгын салбарын тогтвортой хөгжилд ихээхэн хувь нэмэр оруулна хэмээн талууд үзэж байна.</p><p style=\"margin: 16px 0px; padding: 0px; text-size-adjust: 100%; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; font-size: 15px; text-align: justify;\"><em style=\"margin: 0px; padding: 0px; text-size-adjust: 100%;\">“</em><em style=\"margin: 0px; padding: 0px; text-size-adjust: 100%;\">Энэхүү төсөл маань зорьж байсан бүхий л зорилго, үр дүндээ хүрсэн. Шударгаар хэлэхэд төслийн зарим зорилтуудаа бид давуулан биелүүлсэн. Ялангуяа, барилгын салбарын мэргэжилтнүүдийг барилгын хог хаягдлын менежментийн сургалтанд хамруулж бэлдэх, барилгын хог хаягдлын талаарх олон нийтийн ойлголт мэдлэгийг сайжруулах зэрэг ажлууд дээр тавьсан зорилгоо давуулан биелүүлж чадсан. Одоо юу&nbsp; илүү чухал вэ? Төслөөс гарсан үр дүн, ажлуудыг цаашид тогвортой хэрэгжүүлэх ажил хамгийн чухал болоод байна. Төслийн баг маань барилгын салбарыг байгаль орчинд ээлтэй</em>&nbsp;<em style=\"margin: 0px; padding: 0px; text-size-adjust: 100%;\">байлгах, ногоон технологийг нэвтрүүлэх ажил дээр төвлөрч ажилласан. Барилгын салбар жил бүр эрчимтэй хөгжиж буй энэ үед төслийн эдгээр ажлыг цаашид тогтвортой үргэлжлүүлэхэд барилгын салбарынхан, олон нийт та бүхний оролцоо чухал юм. Тиймээс та бүхнийг барилгын хог хаягдлыг газар доор булаад дуусгалгүй түүнийг дахин ашиглаж, дахин боловсруулахыг уриалж байна</em>” хэмээн&nbsp;<strong style=\"margin: 0px; padding: 0px; text-size-adjust: 100%; color: rgb(69, 77, 98);\">Каритас Чех байгууллагын Монгол дахь суурин төлөөлөгч Яна Зилкова онцлон тэмдэглэлээ.</strong></p><p style=\"margin: 16px 0px; padding: 0px; text-size-adjust: 100%; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; font-size: 15px; text-align: justify;\">Энэхүү төсөл хөтөлбөр нь Монголын Хог Хаягдлыг Дахин Боловсруулах Үндэсний Холбоо, Монгол Улсын Шинжлэх Ухаан Технологийн Их Сургууль, Нидерланд улсын Дельтийн Технологийн Их Сургуулийн хамтын ажиллагааны үр дүнд хэрэгжсэн юм.</p><p style=\"margin: 16px 0px; padding: 0px; text-size-adjust: 100%; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Tahoma, Arial, sans-serif; font-size: 15px; text-align: justify;\">Төслийн талаарх дэлгэрэнгүй мэдээллийг&nbsp;<a href=\"https://mongolia.charita.cz/what-we-do/news/switch-asia-project-a-catalyst-for-new-regulation-on-construction-demolition-waste-cdw-management-in-mongolia/\" target=\"_blank\" style=\"margin: 0px; padding: 0px; text-size-adjust: 100%; -webkit-tap-highlight-color: rgba(255, 255, 255, 0); color: rgb(253, 62, 10);\">энэ цахим хуудаснаас&nbsp;</a>авна уу.</p>','Улс төр','ikon.mn',NULL,'2020-11-01 10:45:04');
